void BotSimulator::AddSimulatedData(int tIndex) {
    //This function is the equivalent of BotSaveData() function in TrainerBotManager
    if (tIndex < t_list.size()-1){
        TheTrainer->dataManager.AddData(0, t_list[tIndex]);
        TheTrainer->dataManager.AddData(34, 2);
        TheTrainer->dataManager.AddData(35, 2); 
        TheTrainer->dataManager.AddData(36, d_list[tIndex]); //Distance Left 
        TheTrainer->dataManager.AddData(39, d_list[tIndex]); //Distance Right (that is equal to distance left in the simulation mode)
        TheTrainer->dataManager.AddData(37, v_list[tIndex]); //Velocity Left
        TheTrainer->dataManager.AddData(40, v_list[tIndex]); //Velocity Right (that is equal to velocity left in the simulation mode)
        TheTrainer->dataManager.AddData(38, a_list[tIndex]); //Acceleration Left
        TheTrainer->dataManager.AddData(41, a_list[tIndex]); //Acceleration Right (that is equal to acceleration left in the simulation mode)

        if (TheTrainer->UsingLoadProfile) { //We add the vertical lines to the load profile plot so the user can see in real time the applied load
            TheTrainer->app.AddVerticalLineToPlot(d_list[tIndex], "Left Distance", 2);
            TheTrainer->app.AddVerticalLineToPlot(d_list[tIndex], "Right Distance", 2);
        }
    }
    else { //We automatically stop the Set when there is no data left
        TheTrainer->WantToStopBot = true;
    }
}